import styled from 'styled-components';
import Navigation from './Navigation';

const Sidebar = () => {
    return (
        <SidebarStyled>
            <Navigation />
        </SidebarStyled>
    )
}

const SidebarStyled = styled.div`
    width: 16.3rem;
    height: 100vh;
    position: fixed;
    background-color: var(--sidebar-dark-color);
    overflow: hidden;
    @media screen and (max-width: 1120)
`;

export default Sidebar
